	('inbox/ClausWiegand_1A1SVhkVdQ', 'Ich habe versucht euer System zu verstehen. \n1. Meiner Meinung nach verdienen da nur einzelne Personen dran. Jeder kleine Online Shop wirft mehr Kohle ab. \nFür mich ist ecommerce der Schlüssel zum selbstständigen Leben. Ich selber besitze eine Spedition, weil ich das damals mal für richtig hielt. Mittlerweile habe ich damit 84 Angestellte. Diese habe ich am 01.07.2000 selbst gegründet und war relativ einfach. Vor 4 Jahren habe ich aber meine eigentliche Intuition gefunden. world-of-ahle-wurscht.de. Der Shop ist mit einer 450€ Kraft gut für 2500€-3000€/netto im Monat und ich kann das Ding aus der ganzen Welt steuern. Wenn du mich wirklich fragst, was ich von all den Sachen halte, glaubt an euch selbst und mach dein eigenes Ding.', 'Claus Wiegand', 1537293817622, 'Generic'),
