	('inbox/DavutVarli_426mlaoM9Q', 'Ich finde die Seite schön! Motivation pur, mir ist Das gleiche passiert. Und habe mich auch deshalb bis nach Schweden, bewegt und lebe dort.', 'Davut Varli', 1537556500279, 'Generic'),
	('inbox/DavutVarli_426mlaoM9Q', 'Du hast eine Sprachnachricht versendet.', 'Christian Wiegand', 1537557735830, 'Generic'),
	('inbox/DavutVarli_426mlaoM9Q', 'Eigentlich Was sich Leute in den Kopf gesetzt haben, wie zum Beispiel abnehmen, Muskelb aufbauen oder auch mehr!\nMutivation ist:\nMan wird selbstbewusster stärker im Körper aber auch im Kopf.\n\nHier in Schweden ist es fast jeder...!\n\n80 bis 90 % Ich glaube sowie Sport in Schweden gibt es keinen anderen Land.\nJegliche Art von Sport.\n\nDie Seite kann man noch aufbauen, da bekommt man nicht Viel Informationen.\n\nEin Tipp: Wenn man Sie Seite Gilla bekommt man mehr information, so ist es hier.\n\nEs sind zu wenig Informationen, nur Bilder mit Leuten die ihren Körper aufbauen und machen.', 'Davut Varli', 1537558753724, 'Generic'),
	('inbox/DavutVarli_426mlaoM9Q', 'Cool :) Danke für das Feedback, was hat dir denn am besten Gefallen?', 'Christian Wiegand', 1537559783187, 'Generic'),
	('inbox/DavutVarli_426mlaoM9Q', 'Die Farben blau- Create Yourself dann grün passt zusammen.\n\nDann die Veränderung von ” Dick zu Dünn”\nDann kommt noch  wie die Menschen sich verändert haben, indem Diese ihre Muskeln aufbauen.\n\nNormal sollten die Menschen einen kleinen Kick bekommen, indem diese kontakt haben mit dieser Seite, einen Mutivation abzunehmen!', 'Davut Varli', 1537560086400, 'Generic'),
