	('inbox/EyupSchwarzkopf___JMXMP_Ig', 'ja gerne aber welche gruppe?!', 'Eyüp Schwarzkopf', 1538139324002, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Hey Fabian, wir kennen uns zwar nicht, aber du wurdest mir bei meinen Vorschlägen für neue Freunde angezeigt und ich fand dein Profil cool. Wir haben vor Kurzem in Facebook eine ganz tolle Lifestylegruppe gegründet die wir im Moment optimieren und mir wäre mal ein Feedback von jemanden wichtig, den ich nicht kenne. Wärst du offen mir ein Feedback zu geben? :)\nLiebe Grüße Christian :)', 'Christian Wiegand', 1537202388963, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Hi Christian!\nUm welche Form von Lifestyle geht es denn? Ich hoffe, ich kann dazu was beitragen. In der Regel bin ich eher nicht so richtig mitten im Mainstream und bin dafür eher so Mittel geeignet, um sich an mir zu orientieren.', 'Fabian Gumz', 1537204897070, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Du hast eine Sprachnachricht versendet.', 'Christian Wiegand', 1537204999900, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Ja klar, kein Problem.', 'Fabian Gumz', 1537205062305, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Ich bin allerdings auch eher nicht der typische Fitness Junky. \nIch komme aus dem Kampfsport und mache daher auch viel Krafttraining, habe aber mit "moderner" Fitness, die vor allem Optik orientiert sind und wie du schon sagtest, eher im Lifestyle verhaftet sind, sehr wenig zu tun.', 'Fabian Gumz', 1537205151189, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Zum Beispiel ist es für mich eher schwierig ausreichend Kalorien aufzunehmen, um mein Gewicht zu halten als dass ich klassische Diätziele hätte.', 'Fabian Gumz', 1537205194755, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Was ich jetzt schon sagen kann:\nEs fehlt eine gute Beschreibung der Gruppe, was sie soll und was sie macht.', 'Fabian Gumz', 1537206118240, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Ah, du schaust sie dir schon an, perfekt ðªð»', 'Christian Wiegand', 1537207952551, 'Generic'),
