	('inbox/FabianGumz_H0FyPE-UYg', 'Also die Beiträge an sich von den Teilnehmern sind ja nicht schlecht. Ist manchmal ein bisschen schwer zu glauben, dass die Leute in so kurzer Zeit so krasse Veränderungen erzielen, aber das hört man ja immer wieder in diversen Gruppen.', 'Fabian Gumz', 1537210529482, 'Generic'),
