	('inbox/FabianGumz_H0FyPE-UYg', 'Was ich ändern würde:\nDie Qualität der Stimmen ist relativ schlecht. Das nervt viele Leute schnell.\nSchon für kleinere dreistellige Beträge kann man mittlerweile ziemlich gute Mikrofone kaufen.\nIch persönlich nutze für meine Aufnahmen das Rode NT USB. Meines Erachtens nach ein echter Preiskiller und hätte sofort eine starke Auswirkung auf die Qualität eurer Sprachbeiträge.', 'Fabian Gumz', 1537222780357, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Aber die persönliche Komponente macht aber viel her. Das kreiert auf jeden Fall so ein Zugehörigkeitsgefühl.', 'Fabian Gumz', 1537222869657, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Man hat gleich so dieses Gefühl "Ah! Das kenn ich auch!"', 'Fabian Gumz', 1537222895145, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Wobei, wie gesagt, auf mich trifft das nicht so sehr zu. Ich bin sportlich eigentlich ganz gut drauf.', 'Fabian Gumz', 1537222922306, 'Generic'),
	('inbox/FabianGumz_H0FyPE-UYg', 'Aber mich persönlich nervt es manchmal, wenn die Leute sehr lange um den heißen Brei herum reden.\nWenn man mir ein klares Konzept vorlegt, überzeugt mich das meistens mehr, als ein Sammelsurium von Einzelgeschichten.', 'Fabian Gumz', 1537223067323, 'Generic'),
