	('inbox/JenniferRuckel_g-hiTPfkoA', 'Du hast eine Sprachnachricht versendet.', 'Christian Wiegand', 1536578568716, 'Generic'),
	('inbox/JenniferRuckel_g-hiTPfkoA', 'Ok, wie heißt die Seite? 😊', 'Jennifer Ruckel', 1536605123366, 'Generic'),
	('inbox/JenniferRuckel_g-hiTPfkoA', 'Du hast eine Sprachnachricht versendet.', 'Christian Wiegand', 1536612160294, 'Generic'),
	('inbox/JenniferRuckel_g-hiTPfkoA', 'Ja, du kannst mich einladen. ð', 'Jennifer Ruckel', 1536646817119, 'Generic'),
	('inbox/JenniferRuckel_g-hiTPfkoA', 'Huhu, also ich hab mir gerade die Seite angesehen und mir fehlt da persönlich die "Info". Es gibt keine Begrüßung und Erklärung eurerseits, wer ihr seid und was ihr macht. Klar, der Name verrät schon einiges und anhand der Diskussionen und Beiträge der Mitglieder kann man auch "erahnen", was ihr damit bezwecken wollt. So wie die Seite aktuell gestaltet ist würde ich denken, ihr sammelt Beiträge von Leuten, die sich zum gesunden Leben verändert haben und postet diese auf euerer Seite. Ich hoffe das klingt jetzt nicht zu hart, aber das ist mein erster Eindruck. :)', 'Jennifer Ruckel', 1536842376406, 'Generic'),
	('inbox/JenniferRuckel_g-hiTPfkoA', 'Du hast eine Sprachnachricht versendet.', 'Christian Wiegand', 1536842715953, 'Generic'),
	('inbox/JenniferRuckel_g-hiTPfkoA', 'Also ich finde es gut, dass es ganz verschiedene Themen sind, über die die Leute schreiben und das man immer Bilder der Personen dazu sieht, wie sie sich verändert haben. Durch den längeren aber informativen Text und die Bilder wirkt die Seite sehr aufgeräumt und übersichtlich. :)', 'Jennifer Ruckel', 1536842925918, 'Generic'),
