	('inbox/JurgenSchutz_IwCyRMXZ9Q', 'Sorry das ich jetzt erst antworte Christian. \nIch hatte Spätschicht und viel um die Ohren.\nIch schaue mir das am Wochenende mal in Ruhe an und danke dir für deine Nachricht. \nBis dann erst mal und liebe Grüße Jürgen Schütz \nNagetierhaus Schütz www.nagetierhaus-schuetz.de', 'Jürgen Schütz', 1536270923125, 'Share'),
