	('inbox/JurgenSchutz_IwCyRMXZ9Q', 'Hallo mein Guter, ich hab mir jetzt soweit mal alles angesehen.\nNur dir zuliebe habe ich mir mehr angeschaut um mir ein Urteil erlauben zu dürfen.\nIm Grunde schaue ich mir so etwas gar nicht an, weil ich meinen eigenen Trainer und Ernährungsberater habe.\nManches was ich sehe und lese ist ok, einige zu dünn und ansonsten alles wo ich gemischte Meinungen hätte.\nAlso sei bitte nicht enttäuscht wenn ich nicht mehr dazu schreiben kann und möchte.\nLeider habe ich andere Interessen. \nIch bin Schichtarbeit er und nebenbei Schreiner von Beruf.\nIch wünsche dir ein schönes Wochenende und sende liebe Grüße \nJürgen 🖒🖒🖒', 'Jürgen Schütz', 1536356035368, 'Generic'),
	('inbox/JurgenSchutz_IwCyRMXZ9Q', 'Du hast eine Sprachnachricht versendet.', 'Christian Wiegand', 1536400289525, 'Generic'),
