	('inbox/JurgenSchutz_IwCyRMXZ9Q', 'Hey super freut mich :) schau mal wir haben ein aufgenommenes Video von einem Call in dem die Leute in 15 min. erzählen, wie sie diese Erfolge und ihre Transformationen geschafft haben! Sie geben Tipps :) Wenn ich dir da einfach mal das Video schicke würdest du dir die Zeit nehmen und es dir anschauen? :)', 'Christian Wiegand', 1536429050659, 'Generic'),
	('inbox/JurgenSchutz_IwCyRMXZ9Q', 'Gerne, hab gleich Nachtschicht', 'Jürgen Schütz', 1536430842982, 'Generic'),
