	('inbox/JurgenSchutz_IwCyRMXZ9Q', 'Was denkst du denn bis wann du dir die Zeit nehmen kannst es dir anzuschauen?', 'Christian Wiegand', 1536431181584, 'Generic'),
	('inbox/JurgenSchutz_IwCyRMXZ9Q', 'Gerade angesehen und alles in dieser Art kenne ich seit Jahren.\nAlles ganz toll doch ich schaue mir das nur dir zuliebe an.\nSeit meinem 21 mache ich etwas Sport und meine Ernährung ist voll auf meine Bedürfnisse immer wieder eingestellt worden.\nIch bin kein \nBodybuilder doch habe eigenen Ernährungsberater und Trainer. \nAuch ein kleines eigenes Studio.\nAlso leider schaue ich mir so etwas gar nicht mehr an.\nDann ein schönes Wochenende und liebe Grüße Jürgen', 'Jürgen Schütz', 1536443203984, 'Generic'),
	('inbox/JurgenSchutz_IwCyRMXZ9Q', 'Wünsche dir auch ein schönes Wochenende!', 'Christian Wiegand', 1536443777105, 'Generic'),
	('inbox/JurgenSchutz_IwCyRMXZ9Q', 'Interessiert dich wie wir arbeiten?', 'Christian Wiegand', 1536443847440, 'Generic'),
	('inbox/JurgenSchutz_IwCyRMXZ9Q', 'Nein, leider nicht lieber Christian, aber ich bin offen und ehrlich. \n2 Berufe und Familie mit allem drum und dran kümmern ich mich Intensiv. \nVieles halte ich einfach von mir fern um nicht zu viel um die Ohren zu haben.\nSogar die hälfte meiner Aufträge oder Interessenten lehne ich ab, denn ich möchte nicht so viel um die Ohren.\nBitte um Verständnis🖒🖒🖒', 'Jürgen Schütz', 1536444927796, 'Generic'),
