	('inbox/LukasSeidel_Q4qeHNONOg', 'Gib mir 1-2 Tage! ;)', 'Lukas Seidel', 1536166873151, 'Generic'),
	('inbox/LukasSeidel_Q4qeHNONOg', 'Du hast eine Sprachnachricht versendet.', 'Christian Wiegand', 1536167049258, 'Generic'),
	('inbox/LukasSeidel_Q4qeHNONOg', 'Hallo Christian,\n\nDu hattest um ein Feedback zu Deiner Gruppe „Create Yourself Motivation & Inspiration“ gebeten. Gerne möchte ich Dir diesen ‚Wunsch‘ erfüllen und hoffe dabei, dass ein ehrliches Feedback das ist, was Du möchtest.\n\nErst einmal vorweg: Du sagtest, dass ihr die Gruppe erst kürzlich ins Leben gerufen habt: Jetzt hat sie bereits über 13.000 Mitglieder. Das ist schon einmal beachtlich.\n\n10 Admins und 38 Moderatoren sind eine ziemlich große Gruppe an einflussnehmenden Personen. Aber bei der Gruppengröße sicherlich auch hilfreich.\n\nWas mir eingangs fehlt ist die Beschreibung der Gruppe, die ich auch nach längerem Suchen nicht finden konnte. \n\nQuasi ein Aufhängertext: \nWas macht diese Gruppe aus? Worum geht es in dieser Gruppe? Was ist der Mehrwert, den sie mir als Mitglied bietet? \n\nWeiter fehlen mir Hinweise in folgender Richtung:�Wer postet in dieser Gruppe? Wer darf Beiträge schrieben und hinzufügen? Zu welchen Themen gibt es Beiträge?\n\nIm Titelbild sind jede Menge verschiedene Bilder, die mich als Mitglied in verschiedene Richtungen lenken: \n- Ein Bild mit Getränken in einem Glas\n- Ein Bild mit einem Salat\n- Ein Bild mit Getränken und Salat\n- Ein Bild mit mehreren Personen am Strand\n- Ein Bild im Fitness-Studio\n- Ein Bild mit Personen beim Sport\n- Ein Bild mit einer Frau mit langen Haaren\n- Ein Bild mit einem Cocktail\n\nDaraus leitet sich mir die Frage (ohne Aufhängertext) ab: Wofür steht die Gruppe konkret?\n\nDas erstmal als erstes kleines Feedback. Entschuldige, wenn das vielleicht zu kritisch rüberkommt.\n\nLG �L', 'Lukas Seidel', 1536226923903, 'Generic'),
