	('inbox/ManuelGomeraDeano_xqzwvEGogQ', 'Super :) ich habe dich gerade eingeladen, danke dir schonmal im voraus! https://www.facebook.com/groups/197111937786655/\n\nWas denkst du denn bis wann du dir die Zeit nehmen kannst dir die Gruppe anzuschauen?', 'Christian Wiegand', 1532775991801, 'Share'),
	('inbox/ManuelGomeraDeano_xqzwvEGogQ', 'Klingt gut! Wissen über Ernährung und Sport plus einigen motivierenden Erfolgsgeschichten. Ich hoffe es ist kein Konzept mit Schneeballprinzip um das Konzept bekannt zu machen..😄😉', 'Manuel Gomera Deaño', 1532781015695, 'Generic'),
