	('inbox/PatrickGildemeister_nQsCI-Mi6w', 'Huhu, also positiv an der Gruppe ist das du viele Mitglieder hast und somit auch viele Leute erreicht. Verbessern würde ich : unter Info einen tollen text zur Gruppe einstellen ( sinn und zweck der Gruppe, zusätzlich infos), unter Veranstaltungen Termine hinzufügen ( z.b. Fitnessmessen etc), unter Dokumente würde ich interessante Fitness Texte, Artikel einstellen, eventuell sogar eine Anleitung. Eventuell ein Ansprechpartner bei fragen? Was ich persönlich nicht ganz so toll finde sind viele Beiträge von Mitgliedern die sich ähneln, teil als fake erscheinen und mit als Starter nichts bringen. Bei manchen Beiträgen entsteht der eindruck nach versteckter Firmen werbung', 'Patrick Gildemeister', 1535638520455, 'Generic'),
