	('inbox/PePi_zi1X3Whd_A', 'Naja, wir kennen uns leider noch nicht, aber du wurdest mir bei meinen Vorschlägen für neue Freunde angezeigt und ich fand dein Profil cool. Wir haben vor Kurzem in Facebook eine ganz tolle Lifestylegruppe gegründet die wir im Moment optimieren und mir wäre mal ein Feedback von jemanden wichtig, den ich nicht kenne. Wärst du offen mir ein Feedback zu geben? :)\nLiebe Grüße Christian :)', 'Christian Wiegand', 1537471219805, 'Generic'),
	('inbox/PePi_zi1X3Whd_A', 'Ok was  ist das für eine Gruppe  ?', 'Pe Pi', 1537471308526, 'Generic'),
	('inbox/PePi_zi1X3Whd_A', 'Guten Abend, es geht um Motivation und Inspiration zu mehr Fitness und Gesundheit 💪🏻, wir teilen dort unsere Stories einfach, von dem was wir erreicht haben. Wenn ich dich da einfach mal einladen würde, könntest du uns dann kurz deine Meinung geben, wie sie rüber kommt, ob man etwas verbessern könnte, oder ob etwas fehlt? :)', 'Christian Wiegand', 1537471523962, 'Generic'),
	('inbox/PePi_zi1X3Whd_A', 'Pe: 󰀀', 'Pe Pi', 1537471554524, 'Generic'),
