	('inbox/TillRuther_mvBU8_rg5Q', 'Vllt sehe ich sie nicht in der App? Ich schaue morgen mal am pc', 'Till Rüther', 1539112132064, 'Generic'),
	('inbox/TillRuther_mvBU8_rg5Q', 'Hi Christian, \n\nalso wie ich das sehe geht es bei der Seite hauptsächlich darum, körperliche Verbesserungen zu dokumentieren. Was ich dabei auf den ersten Blick vermisse ist vor allem die spirituelle Transformation. Denn es ist nicht leicht, überhaupt einmal einen schlechten Zustand im eigenen Leben anzuerkennen und ihn dann für die Person zu opfern, die man werden könnte.', 'Till Rüther', 1539167316685, 'Generic'),
	('inbox/TillRuther_mvBU8_rg5Q', 'Die äußerliche Erscheinung ist da nur die sprichwörtliche Spitze des Eisbergs', 'Till Rüther', 1539167352471, 'Generic'),
