	('inbox/XenosQuintinSchirmer_UzAvYJbP0Q', 'Hey, hab gesehen du folgst mir bei Insta! Supergeil! Wie geht\'s dir?', 'Christian Wiegand', 1536233162690, 'Generic'),
	('inbox/YvonneRathsack_E1qxq2fU7w', 'Hey Yvonne, wir kennen uns zwar nicht, aber du wurdest mir bei meinen Vorschlägen für neue Freunde angezeigt und ich fand dein Profil cool. Wir haben vor Kurzem in Facebook eine ganz tolle Lifestylegruppe gegründet die wir im Moment optimieren und mir wäre mal ein Feedback von jemanden wichtig, den ich nicht kenne. Wärst du offen mir ein Feedback zu geben? :)\nLiebe Grüße Christian :)', 'Christian Wiegand', 1533926893402, 'Generic'),
	('inbox/YvonneScoggins_JRnv_Nj70A', 'Hey Yvonne, wie geht’s dir? :)', 'Christian Wiegand', 1537726832322, 'Generic'),
	('inbox/YvonneScoggins_JRnv_Nj70A', 'Guten morgen , danke der Nachfrage . Uns geht es gut, aber das wetter lässt zu wünschen übrig', 'Yvonne Scoggins', 1537762191263, 'Generic'),
	('inbox/YvonneScoggins_JRnv_Nj70A', 'Das freut mich :) Mir geht´s auch gut. Wie war dein Wochenende? :)', 'Christian Wiegand', 1537817894558, 'Generic'),
	('inbox/ZakiAlMaboren_p5Im6MVrzA', 'Hey Zaki, wir kennen uns zwar nicht, aber du wurdest mir bei meinen Vorschlägen für neue Freunde angezeigt und ich fand dein Profil cool. Wir haben vor Kurzem in Facebook eine ganz tolle Lifestylegruppe gegründet die wir im Moment optimieren und mir wäre mal ein Feedback von jemanden wichtig, den ich nicht kenne. Wärst du offen mir ein Feedback zu geben? :)\nLiebe Grüße Christian :)', 'Christian Wiegand', 1536478950324, 'Generic'),
	('inbox/ZakiAlMaboren_p5Im6MVrzA', 'Ja, ich bin reale Person, aufgrund unserer gemeinsamen Bekanntschaften habe ich meine Freundschaft oder Kontaktanfrage gesendet, mehr über mich steht auf meine FB Seite.  \nSonst: maboren.net Gruß. Zaki', 'Zaki Al-Maboren', 1536482252640, 'Share'),
	('inbox/ZakiAlMaboren_p5Im6MVrzA', 'Du hast eine Sprachnachricht versendet.', 'Christian Wiegand', 1536482327564, 'Generic'),
	('inbox/ZakiAlMaboren_p5Im6MVrzA', 'Ich werde es später tun weil ich gerade arbeite 😊', 'Zaki Al-Maboren', 1536493910344, 'Generic'),
	('inbox/ZakiAlMaboren_p5Im6MVrzA', 'Du hast eine Sprachnachricht versendet.', 'Christian Wiegand', 1536495385990, 'Generic'),
	('inbox/ZulgaiMuhamadi_u1eRLYnVAQ', 'Hey Zulgai, wir kennen uns zwar nicht, aber du wurdest mir bei meinen Vorschlägen für neue Freunde angezeigt und ich fand dein Profil cool. Wir haben vor Kurzem in Facebook eine ganz tolle Lifestylegruppe gegründet die wir im Moment optimieren und mir wäre mal ein Feedback von jemanden wichtig, den ich nicht kenne. Wärst du offen mir ein Feedback zu geben? :)\nLiebe Grüße Christian :)', 'Christian Wiegand', 1536964071848, 'Generic');
