-- Entferne temporäre Tabelle und erstelle die eigentliche View
DROP TABLE IF EXISTS `customers`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `customers` AS SELECT p.title-- , id, lastReaction, p.friendsSince, p.firstContact, state, notes, nachfassen
FROM persons p
	right join
	(
		SELECT *
		FROM properties
		WHERE state = 'Kunde'
	) s
	on p.title = s.title and p.friendsSince = s.friendsSince ;

-- Exportiere Struktur von View createyourselfdb.group_send
-- Entferne temporäre Tabelle und erstelle die eigentliche View
DROP TABLE IF EXISTS `group_send`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `group_send` AS select p.title as title-- , content
from messages m left join persons p on m.id = p.id
where m.sender_name = 'Christian Wiegand'
and (
m.CONTENT like '%https://www.facebook.com/groups/197111937786655/%'
)
and title not in (select title from in_group) 
and title not in (select title from video) 
and title not in (select title from customers) ;

-- Exportiere Struktur von View createyourselfdb.in_group
-- Entferne temporäre Tabelle und erstelle die eigentliche View
DROP TABLE IF EXISTS `in_group`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `in_group` AS select title
from cy
where
title not in (select title from video) and
title not in (select title from customers) ;

-- Exportiere Struktur von View createyourselfdb.unwritten
-- Entferne temporäre Tabelle und erstelle die eigentliche View
DROP TABLE IF EXISTS `unwritten`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `unwritten` AS select title-- , id
from persons
-- Alle, wo es keine Nachrichten gibt -> lastReaction = 0 and firstContact = 0
-- Alle, wo es Nachrichten gibt, aber nicht von mir -> or id not in
where lastReaction = 0 and firstContact = 0 or id not in
-- Alle, die eine Nachricht von mir haben
	(
	select distinct id
	from messages
	where sender_name = 'Christian Wiegand') ;

-- Exportiere Struktur von View createyourselfdb.video
-- Entferne temporäre Tabelle und erstelle die eigentliche View
DROP TABLE IF EXISTS `video`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `video` AS select p.title-- , content
from messages m left join persons p on m.id = p.id
where m.sender_name = 'Christian Wiegand'
and (
m.CONTENT like '%https://www.youtube.com/watch?v=A2_xGg_O2lE%' or
m.CONTENT like '%https://youtu.be/opBGuztAvtw%' or
m.CONTENT like '%https://youtu.be/gJxp4loJyyA%'
)
and p.title not in (select title from customers) ;

-- Exportiere Struktur von View createyourselfdb.written
-- Entferne temporäre Tabelle und erstelle die eigentliche View
DROP TABLE IF EXISTS `written`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `written` AS select title-- , content
from persons
where firstContact != 0
and title not in (select title from unwritten)
and title not in (select title from group_send)
and title not in (select title from in_group)
and title not in (select title from video)
and title not in (select title from customers) ;

